import React, { useState } from 'react';
import { useAuth } from './context/AuthContext';
import { useNavigate } from 'react-router-dom';
import { addTask, deleteTask, editTask } from '../api/azureFunctions';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
import './Dashboard.css';

const Dashboard = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const [tasks, setTasks] = useState([]);
  const [newTask, setNewTask] = useState({ description: '', priority: 'Medium', status: 'To Do' });

  const handleLogout = async () => {
    await logout();
    navigate('/login');
  };

  const handleAddTask = async () => {
    if (!newTask.description) return;
    try {
      const created = await addTask(newTask);
      setTasks([...tasks, created]);
      setNewTask({ description: '', priority: 'Medium', status: 'To Do' });
    } catch (err) {
      console.error('Failed to add task:', err);
    }
  };

  const handleDelete = async (taskId) => {
    try {
      await deleteTask(taskId);
      setTasks(tasks.filter((task) => task.id !== taskId));
    } catch (err) {
      console.error('Failed to delete task:', err);
    }
  };

  const handleUpdateStatus = async (taskId, newStatus) => {
    try {
      const updated = await editTask(taskId, { status: newStatus });
      setTasks(tasks.map((task) => (task.id === taskId ? updated : task)));
    } catch (err) {
      console.error('Failed to update task status:', err);
    }
  };

  const onDragEnd = (result) => {
    const { source, destination, draggableId } = result;
    if (!destination || source.droppableId === destination.droppableId) return;
    handleUpdateStatus(draggableId, destination.droppableId);
  };

  const categories = ['To Do', 'In Progress', 'Done'];

  return (
    <div className="dashboard">
      <header>
        <h1>Welcome, {user?.name || 'User'}</h1>
        <button onClick={handleLogout}>Logout</button>
      </header>

      <div className="task-form">
        <input
          type="text"
          placeholder="Task description"
          value={newTask.description}
          onChange={(e) => setNewTask({ ...newTask, description: e.target.value })}
        />
        <select
          value={newTask.priority}
          onChange={(e) => setNewTask({ ...newTask, priority: e.target.value })}
        >
          <option value="Low">Low</option>
          <option value="Medium">Medium</option>
          <option value="High">High</option>
        </select>
        <button onClick={handleAddTask}>Add Task</button>
      </div>

      <DragDropContext onDragEnd={onDragEnd}>
        <div className="task-columns">
          {categories.map((category) => (
            <Droppable droppableId={category} key={category}>
              {(provided) => (
                <div
                  className="task-column"
                  {...provided.droppableProps}
                  ref={provided.innerRef}
                >
                  <h2>{category}</h2>
                  {tasks
                    .filter((task) => task.status === category)
                    .map((task, index) => (
                      <Draggable draggableId={task.id} index={index} key={task.id}>
                        {(provided) => (
                          <div
                            className="task-card"
                            ref={provided.innerRef}
                            {...provided.draggableProps}
                            {...provided.dragHandleProps}
                          >
                            <p><strong>{task.description}</strong></p>
                            <p>Priority: {task.priority}</p>
                            <div className="task-actions">
                              <button onClick={() => handleDelete(task.id)}>Delete</button>
                            </div>
                          </div>
                        )}
                      </Draggable>
                    ))}
                  {provided.placeholder}
                </div>
              )}
            </Droppable>
          ))}
        </div>
      </DragDropContext>
    </div>
  );
};

export default Dashboard;
